package com.ywhk.ckb.dao.model.core;import lombok.Data;import javax.persistence.*;import java.util.Date;/** * 疾病目录 */@Data@Entity@Table(name = "KLN_BAS_Disease")public class DiseaseListEntity {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    @Column(name = "FDiseaseID", nullable = false)    private Integer FDiseaseID;    @Column(name = "FDiseaseTypeID", nullable = false)    private Integer FDiseaseTypeID;    @Column(name = "FOrderNumber", nullable = false)    private Integer FOrderNumber;    @Column(name = "FDiseaseNumber", nullable = false, length = 50)    private String FDiseaseNumber;    @Column(name = "FDiseaseName", nullable = false, length = 50)    private String FDiseaseName;    @Column(name = "FGeneralSituation", nullable = false, length = 16)    private String FGeneralSituation;    @Column(name = "FSyndromeDifferentiationTreatment", nullable = false, length = 16)    private String FSyndromeDifferentiationTreatment;    @Column(name = "FGuardAgainst", nullable = false, length = 16)    private String FGuardAgainst;    @Column(name = "FStandard", nullable = false, length = 16)    private String FStandard;    @Column(name = "FDiseaseType", nullable = false)    private Integer FDiseaseType;    @Column(name = "FPy", nullable = false, length = 50)    private String FPy;    @Column(name = "FWb", nullable = false, length = 50)    private String FWb;    @Column(name = "FExp", nullable = false, length = 200)    private String FExp;    @Column(name = "FMark", nullable = false)    private Integer FMark;    @Column(name = "FCreateDate", nullable = false, length = 8)    private Date FCreateDate;    @Column(name = "FCreateuserID", nullable = false)    private Integer FCreateuserID;    @Column(name = "FModifyDate", nullable = false, length = 8)    private Date FModifyDate;        @Column(name = "FModifyUserID", nullable = false)    private Integer FModifyUserID;}